// ================= src/components/Ambulance.js =================
import React from "react";

export default function Ambulance() {
  return (
    <div>
      <h2>Ambulance Booking</h2>
      <button>Book Ambulance</button>
      <p>Live ETA: 8 minutes</p>
    </div>
  );
}
